import { useRef, useState, Suspense } from 'react'
import { Canvas, useFrame } from '@react-three/fiber'

import { useGLTF } from '@react-three/drei'
import { OrbitControls, Html, draco } from '@react-three/drei'

function Shoe({ ...props }) {
  const group = useRef()
  const { nodes, materials } = useGLTF('shoe.glb')
  return (
    <group ref={group} {...props} dispose={null}>
      <mesh geometry={nodes['Nike_Air_Max_-_Fixed'].geometry} material={materials['default']} rotation={[-5.06, -0.35, 0.99]} scale={0.1} />
    </group>
  )
}

function Light(){
  return(
    <></>
  )
}

export default function App() {
  return (
    <Canvas colorManagement shadowMap camera={{ position: [-5, 4, 4], fov: 40 }}>
      <ambientLight intensity={0.5} />
      <OrbitControls />
      <Suspense fallback={null}>
        <Shoe />
      </Suspense>
    </Canvas>
  )
}
